const Header = () =>(
    <div><h1>Half Stack application development</h1></div>
)
const Part =(props) =>(
    <p>{props.name} {props.number}</p>
)
const Content =(props)=>{
    return (
        <div>
            <Part name= 'Fundamentals of React' number ='10'/>
            <Part name= 'Using props to pass data' number='7'/>
            <Part name= 'State of a component' number='14'/>

        </div>
    )
}
const Total = (props) => (
    <p>Number of exercises {props.one+props.two+props.three}</p>
)

const App = () => {
    const exercises1 = 10
    const exercises2 = 7
    const exercises3 = 14
    return (
      <div>
          <Header/>
          <Content/>
          <Total one={exercises1} two={exercises2} three={exercises3}/>

      </div>
  )
}

export default App
